import styled from 'styled-components';
import { Link } from 'react-router-dom';
import theme from '../../Theme/theme';
import bp from '../../Theme/breakpoints';
import twitter_img from '../../../assets/images/twitter.svg';
import github_img from '../../../assets/images/github.svg';
import discord_img from '../../../assets/images/discord.svg';
import { SmartphoneOutlined } from '@material-ui/icons';

const StyledFooter = styled.footer`
	align-items: center;
	text-align: center;
	background: ${theme.color.background};
	width: 100%;
	padding-top: 48px;
`;

const FooterWrapper = styled.div`
	max-width: 1560px;
	margin: 0 auto;
	display: flex;
	justify-content: space-around;
	@media ${bp.sm} {
		display: flex;
		padding: 0 48px;
		text-align: left;
	}
`;

const FooterDiv = styled.div`
	display: flex;
	@media ${bp.sm} {
		margin-right: 0px;
	}
`;

const SocialLinkImg = styled.img`
	width: 10%;
	margin-bottom: 24px;
	padding-left: 20px;

	@media ${bp.sm} {
		max-width: 200px;
	}
`;

const Copyright = styled.p`
	color: ${theme.color.text};
	font-size: 16px;
	position: absolute;
	width: 100%;
	line-height: 40px;
	text-align: center;
`;

const Footer = () => {
	return (
		<StyledFooter>
			<FooterWrapper>
				<FooterDiv>
					<SocialLinkImg src={twitter_img} alt="twitter" />
					<SocialLinkImg src={github_img} alt="github" />
					<SocialLinkImg src={discord_img} alt="discord" />
				</FooterDiv>
				<FooterDiv>
					<Copyright>Copyright Vessel Â© 2022</Copyright>
				</FooterDiv>
				<FooterDiv></FooterDiv>
			</FooterWrapper>
		</StyledFooter>
	);
};

export default Footer;
